svg.script:
var gp = document.getElementById("geoplus")
var gm = document.getElementById("geominus")
var elements=[]
var ecnt=0;
for(var i = 1;i<=13;i++){
	elements.push(document.getElementById("geo"+i))
	document.getElementById("g"+i+"end").addEventListener('keyup',function(f){
		if(f.srcElement.getAttribute('readonly')!='true'){
			if(f.key=='Backspace'){
				f.srcElement.value=f.srcElement.value.slice(0,-1)
			}else if(!isNaN(f.key)){
			}
			else{
				f.srcElement.value=f.srcElement.value.slice(0,-1)
			}}
			else{}
	})
}
console.log(elements);

webMI.data.subscribe("AGENT.OBJECTS.Test.ForMainWindow.Geology", function(e) {
var id = "id_0";
var val = e.value;
console.log("f")
console.log(val)
if(val==""){
console.log("u")
	elements.forEach(function(e,cnt){if(cnt!=0){e.style.display="none"}})
	document.getElementById("g1start").value=0
	document.getElementById("g1end").removeAttribute("readonly") //#
	ecnt=1;
}else{
	val = JSON.parse(val)
	val.forEach(function(e,cnt){
		//console.log(e)
		//console.log(cnt)

		ecnt=cnt+2
		var b=cnt+1
		elements[b].style.display="block"
		document.getElementById("g"+b+"name").value=e.name
		document.getElementById("g"+b+"start").value=e.start
		document.getElementById("g"+b+"end").value=e.end
		document.getElementById("g"+b+"end").setAttribute("readonly",true)
		//document.getElementById("g"+b+"end").removeEventListener('keyup',function(f){if(f.key=='Backspace'){document.getElementById("g"+b+"end").value=document.getElementById("g"+b+"end").value.slice(0,-1)}else if(!isNaN(f.key)){}else{document.getElementById("g"+b+"end").value=document.getElementById("g"+b+"end").value.slice(0,-1)}})
		console.log(b)
		document.getElementById("g"+ecnt+"start").value=e.end
		document.getElementById("g"+ecnt+"end").value=""
		document.getElementById("g"+ecnt+"end").removeAttribute("readonly")
		//document.getElementById("g"+ecnt+"end").addEventListener('keyup',function(f){if(f.key=='Backspace'){document.getElementById("g"+ecnt+"end").value=document.getElementById("g"+ecnt+"end").value.slice(0,-1)}else if(!isNaN(f.key)){}else{document.getElementById("g"+ecnt+"end").value=document.getElementById("g"+ecnt+"end").value.slice(0,-1)}})

	})
	for(var i=ecnt;i<13;i++){
		elements[i].style.display="none"
	}
}
});

gp.addEventListener('click',function(e){
	var cres=[] 
	for(var i=1;i<=ecnt;i++){
		var buf={}
		buf.name=document.getElementById("g"+i+"name").value
		buf.start=document.getElementById("g"+i+"start").value
		buf.end=document.getElementById("g"+i+"end").value
		cres.push(buf)
	}
	console.log(cres)
	webMI.data.write("AGENT.OBJECTS.Test.ForMainWindow.Geology",JSON.stringify(cres))
})
gm.addEventListener('click',function(e){
	webMI.data.read("AGENT.OBJECTS.Test.ForMainWindow.Geology",function(e){
	//валидация на 0 есть
		var val=JSON.parse(e.value)
		var res=[]
		for(var i=0;i<val.length-1;i++){
			res.push(val[i])
		}
		if(res.length==0){console.log("her");res=''; webMI.data.write("AGENT.OBJECTS.Test.ForMainWindow.Geology",res)}
		else{
		console.log(res)
		//console.log(val)
		//console.log(res)
		webMI.data.write("AGENT.OBJECTS.Test.ForMainWindow.Geology",JSON.stringify(res))
		}
	})
})
webMI.data.subscribe("AGENT.OBJECTS.Depth_day_data.plan_data", function(e) {
var id = "id_18";
var value = JSON.parse(e.value);
value = value[value.length-1].vD
webMI.gfx.setText(id, value);

});
